import React from 'react';
import './StyleMembers.css';


const Members = () => {

  return (
    <>
      <centerAllCont>

        <h1>Meet Our Executive Board</h1>

        <h1>General Members</h1>

      </centerAllCont>

      <h3>2020-2021</h3>
    </>
  );
};

export default Members;
